window.bookSummaryJSON = "<p>The Resistance has barely nursed its wounds from the recapture of Blackout, and now it's looking to another tougher target: the massive steam-powered railway gun known as the Landquaker, the sentry gun of the formidable Iron Wall.</p> <p>To conquer this rail-mounted cannon, Jacob and company turn to old allies and new friends, from the land-loving tribes to the land-roving biker gangs. They'll need every soldier they can muster.&nbsp;</p> <p>The Landquaker was designed with a singular purpose: a monstrous gun to hold back a multitude of monsters. Except this time the multitude mans that weapon, and in its hands the land is not the only thing that quakes.</p>"; 
